generated.css:
*{
    margin: 0;
    padding: 0;
}

body {
    background-color: #ff0000;
}

div {
    margin: auto;
    position: absolute;
    background-color: #fff;
    text-align: center;
    border-radius: 30px;
    width: 200px;
    height: 250px;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    padding: 50px;
}

input {
    width: 150px;
    height: 30px;
    border: 2px solid #ff0000;
    border-radius: 15px;
    background-color: #fff;
    outline: none;
    text-align: center;
}

button {
    height: 30px;
    width: 100px;
    border: 2px solid #ff0000;
    border-radius: 15px;
    background: #fff;
    margin-top: 10px;
    outline: none;
}

table {
    margin-top: 20px;
    margin-left: 10px;
    border: 2px solid #ff0000;
    background: #fff;
    border-collapse: collapse;
    width: 180px;
}
